import React from "react";
import Gallerynav from "./Admingallerynav";
import Painting from "./AdminPainting";
import Sculpture from "./AdminSculpture";
import AdminNavbar from "./AdminNavbar";
import "./Admingallery.css";
import All from "./AdminAll";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  NavLink,
} from "react-router-dom";

const Gallery = () => {
  return (
    <div>
      <AdminNavbar></AdminNavbar>
      <div className="gnavbar">
        <div className="gnavCenter">
          <ul className="gnavList">
            <li className="gnavItem">
              {/*              <Link to="/All" style={{ textDecoration: "none", color: "gray" }}>
                All
              </Link>
  */}
            </li>
            <li className="gnavItem">
              <Link
                to="/Painting"
                style={{ textDecoration: "none", color: "gray" }}
              >
                Painting
              </Link>
            </li>
            <li className="gnavItem">
              <Link
                to="/Sculpture"
                style={{ textDecoration: "none", color: "gray" }}
              >
                Sculpture
              </Link>
            </li>
          </ul>
        </div>
      </div>

      <Routes>
        <Route exact path="/Painting" element={<Painting />} />

        <Route exact path="/Sculpture" element={<Sculpture />} />
        <Route exact path="/All" element={<All />} />
      </Routes>
    </div>
  );
};

export default Gallery;
